// Controls all animation, interactivity, etc. for the WISPR section

var selector = document.getElementById("orbit_num");
var orbit = '1';
var NUMORBITS = 15;

function png_url(orb, camera){ // Converts '2' to '02', '10' to '10', etc. 
  var o = '';
  wispr_url = "https://wispr.nrl.navy.mil/data/rel/pngs/PNGs_Orbit"
  if (parseInt(orb) < 10){
    o = '0'+parseInt(orb).toString();
  } else{
    o = parseInt(orb).toString();
  }
  if (parseInt(orb)==5){
    return wispr_url + o + '_' + camera + '_Encounter/';
  } else{
    return wispr_url + o + '_' + camera + '/';
  }
}

function update_data(){ // updates the images, location, etc. every time the slider changes
  fits = fitsLists[orbit_ind][slider_val]; 
  var date = fits[0].substring(0,12);
  var dist = fits[6].toFixed(3);
  if (allInnerPNGsMatch[orbit_ind].includes(date)){
    document.getElementById("innerimg").src = innerURL + innerPNGs[allInnerPNGsMatch[orbit_ind].indexOf(date)]; // updates image for inner camera
  } 
  if (allOuterPNGsMatch[orbit_ind].includes(date)){
    document.getElementById("outerimg").src = outerURL + outerPNGs[allOuterPNGsMatch[orbit_ind].indexOf(date)]; // updates image for outer camera
  }
  document.getElementById("locplot").src = "public/orbit_plot_" + orbit + ".png"; // updates image for position display
  document.getElementById("disttxt").innerHTML = "Distance: " + dist.toString() + " AU";
  document.getElementById("datetxt").innerHTML = fits[1];
  var scale_factor = 193000000;
  var x = fitsLists[orbit_ind][slider_val][3];
  var y = fitsLists[orbit_ind][slider_val][4];
  var angle;
  loc.style.left = (-13 + x / scale_factor).toString() + 'px';
  loc.style.top = (-287 - y / scale_factor).toString() + 'px';
  if (x>0){
    angle = Math.atan(y/x);
  } else {
    angle = Math.PI - Math.atan(y/-x);
  }
  loc.style.transform = "rotate(" + (2*Math.PI-angle) + "rad)";
}
function play_loop(){
  if (!stopplay){
    var increment = 2;
    max = parseInt(slider.max);
    if (slider_val < max-increment){
      slider_val += increment;
      slider.value = slider_val.toString();
    } else {
      slider_val = 0;
      slider.value = slider_val.toString();
    }
    update_data();
  }
}
function help_load(orb){ // trying to help the wispr images load quicker
  innerPNGs = allInnerPNGs[orb];
  outerPNGs = allOuterPNGs[orb];
  innerURL= png_url((orb+1).toString(), "inner")
  outerURL = png_url((orb+1).toString(), "outer")
  for (var i=0; i<innerPNGs.length; i++){
    document.getElementById("innerimg").src = innerURL + innerPNGs[i];
  }
  for (var o=0; i<outerPNGs.length; i++){
    document.getElementById("outerimg").src = outerURL + outerPNGs[o];
  }
}
var innerPNGs;
var outerPNGs;
var innerURL;
var outerURL;
var orbit_ind = 0;
// Updates the current selector value for orbit number
selector.oninput = function(){
  orbit = selector.value;
  orbit_ind = parseInt(orbit)-1;
  innerPNGs = allInnerPNGs[orbit_ind];
  outerPNGs = allOuterPNGs[orbit_ind];
  innerURL= png_url(orbit, "inner");
  outerURL = png_url(orbit, "outer");
  document.getElementById("innerimg").src = innerURL + innerPNGs[0]; //CHANGE
  document.getElementById("outerimg").src = outerURL + outerPNGs[0]; //CHANGE
  slider.value = '0'; // resets slider value to 0 every time orbit is changed
  slider_val = 0;
  slider.max = fitsLists[orbit_ind].length - 1; // changes slider range to match indices of the fits data points
  update_data();
}

var slider = document.getElementById("sliderrr");
var speed = document.getElementById("speeed");
var slider_val = 0;
var fits = [];
var loc = document.getElementById("psploc");
var stopplay;
var curr_speed = 8; // current speed in fps
var max_speed = 30;
var min_speed = 1;
var max; // max value of slider
var timer;
// Update the current slider value (each time you drag the slider handle)
slider.oninput = function() {
  slider_val = parseInt(this.value);
  update_data();
}

function playclick(){
  var play = document.getElementById("playbutton")
  play.classList.toggle("paused");
  if (play.className=="button paused"){
    slider.style.opacity = 0;
    stopplay = false;
    timer = setInterval(play_loop, 1000 / curr_speed);
    document.getElementById("wisprfasterbutton1").style.left = (window.innerWidth*0.9/2 + 28) + "px";
    document.getElementById("wisprfasterbutton2").style.left = (window.innerWidth*0.9/2 + 28 + 14) + "px";
    document.getElementById("wisprslowerbutton1").style.right = (window.innerWidth*0.9/2 + 28) + "px";
    document.getElementById("wisprslowerbutton2").style.right = (window.innerWidth*0.9/2 + 28 + 14) + "px";
    document.getElementById("speedsection").style.opacity = 1;
  } else{
    // document.getElementById("clicktoplay").innerHTML = "stopped";
    slider.style.opacity = 1;
    stopplay = true;
    clearInterval(timer);
    document.getElementById("wisprfasterbutton1").style.left = "50%";
    document.getElementById("wisprfasterbutton2").style.left = "50%";
    document.getElementById("wisprslowerbutton1").style.right = "50%";
    document.getElementById("wisprslowerbutton2").style.right = "50%";
    document.getElementById("speedsection").style.opacity = 0;
    
  }
}
function playfaster(n){
  if (curr_speed < max_speed + 1 - n){
    curr_speed += n
    stopplay = true;
    clearInterval(timer);
    stopplay = false;
    timer = setInterval(play_loop, 1000 / curr_speed);
    document.getElementById("speeddisplay").innerHTML = curr_speed + " FPS";
  } else if (curr_speed != max_speed) {
    curr_speed = max_speed;
    stopplay = true;
    clearInterval(timer);
    stopplay = false;
    timer = setInterval(play_loop, 1000 / curr_speed);
    document.getElementById("speeddisplay").innerHTML = curr_speed + " FPS";
  }
}
function playslower(n){
  if (curr_speed > min_speed - 1 + n){
    curr_speed -= n
    stopplay = true;
    clearInterval(timer);
    stopplay = false;
    timer = setInterval(play_loop, 1000 / curr_speed);
    document.getElementById("speeddisplay").innerHTML = curr_speed + " FPS";
  } else if (curr_speed != min_speed) {
    curr_speed = min_speed;
    stopplay = true;
    clearInterval(timer);
    stopplay = false;
    timer = setInterval(play_loop, 1000 / curr_speed);
    document.getElementById("speeddisplay").innerHTML = curr_speed + " FPS";
  }
}

// Shows/hides the PSP's FOV on click
var psp = document.getElementById('psptriangle');
var pspON = false; 
psp.onclick = function(){
  pspON = !pspON
  if (pspON){
    document.getElementById("fov1").style.opacity = 0.5;
    document.getElementById("fov2").style.opacity = 0.5;
  } else {
    document.getElementById("fov1").style.opacity = 0;
    document.getElementById("fov2").style.opacity = 0;
  }
}
